/**
 * @param {number[]} nums
 * @return {number}
 */
var specialPerm = function(nums) {
    const mod = 1e9 + 7;
    nums.sort((a, b) => a - b);
    const n = nums.length;
    const dp = new Array(1 << n).fill(0);
    dp[0] = 1;

    for (let mask = 1; mask < (1 << n); mask++) {
        for (let i = 0; i < n; i++) {
            if ((mask & (1 << i)) === 0) continue;
            const prevMask = mask ^ (1 << i);
            if (!dp[prevMask]) continue;
            let valid = i === 0 ? true : false;
            for (let j = 0; j < n; j++) {
                if (mask & (1 << j)) {
                    if (nums[i] % nums[j] === 0 || nums[j] % nums[i] === 0) {
                        valid = true;
                        break;
                    }
                }
            }
            if (valid) dp[mask] = (dp[mask] + dp[prevMask]) % mod;
        }
    }

    return dp[(1 << n) - 1];
};
